import React from 'react';
import { StyleSheet, TextInput, Picker, Text } from "react-native";
// import { Picker } from "react-native-web";
import './App.css';

function App() {
  const [selectedLanguage, setSelectedLanguage] = React.useState();

  return (
    <div className="App" style={{paddingTop:40}}>
      <Text style={styles.titletext}>COVID Timeline Genetator</Text>
      <div className="App-page">

        <div className="inputData">
          <div className="inputpadding" style={{ padding: 10 }}>
            <h1 style={{ color: '#27a742' }}>ข้อมูลผู้ป่วย</h1>

            <span>
              <h2>เพศ</h2>
              <Picker style={styles.picker}>
                <Picker.Item label="ชาย" value="man" />
                <Picker.Item label="หญิง" value="woman" />
              </Picker>
              <h2>อายุ</h2>
              <TextInput
                style={styles.textinput}
                placeholder="อายุ"
              />
            </span>

            <h2>อาชีพ</h2>
            <TextInput
              style={styles.textinput}
              placeholder="อาชีพ"
            />
          </div>

          <div className="inputpadding" style={{ padding: 15 }}>
            <h1 style={{ color: '#27a742' }}>ข้อมูลไทม์ไลน์</h1>
              <h2>วันเวลา</h2>
              <Picker style={styles.picker}>
                <Picker.Item label="ชาย" value="man" />
                <Picker.Item label="หญิง" value="woman" />
              </Picker>

            <h2>รายละเอียด</h2>
            <TextInput
              style={styles.textinput}
            />
          </div>
        </div>

        <div className="showData">
          <h1>test</h1>
        </div>
      </div>
    </div >
  );
}

const styles = StyleSheet.create({
  titletext: {
    fontFamily: 'Prompt',
    fontSize: 28,
    color: '#ffc107',
    paddingLeft:40
  },

  picker: {
    fontFamily: 'Prompt',
    fontSize: 16,
  },

  textinput: {
    fontFamily: 'Prompt',
    fontSize: 16,
    height: 40,
    padding: 5,
    borderRadius: 5,
    backgroundColor: "#fff"
  }
});

export default App;
